                    <div className={classNames('app-form-subscribe-item', {'error' : _.get(error, 'name')})}>
                        <input id="name-id" value={user.name} onChange={this.onTextFieldChange} type="text" placeholder="Full name" name="name" />
                    </div>
                </form>
            </div>
        )
    }
}
